import React from 'react'

const Image = ({ image }) => {
  return (
    <div>
      <div>
        {image.name}
      </div>

      <div>
        <img src={image.generatedImage}></img>
      </div>

      <div>
        {image.promt}
      </div>
    </div>
  )
}

export default Image
